import React, { useState } from 'react'
import { Text, View, StyleSheet, ImageBackground } from "react-native"
import TextBox from "../components/TextBox"
import Btn from "../components/Btn"
import { YellowBox } from 'react-native-web'


const styles = StyleSheet.create({
    view: {
        width: '100%',
        height: '100%',
        flex: 1,        
    },

    btn1: {
        color:'red',
        height: 42,
        width: "82%",
        borderRadius: 25,
        marginTop: "175%",
        marginBottom:"10%",
        backgroundColor: "#4D1A70",
        justifyContent: "center",
   
    },
    fondo:{
        flex: 2,
        height:'100%',
        width: '100%',
        resizeMode:'contain',
        alignItems:'center',     
    },

    btn2:{


        height: 42,
        width: "82%",
        borderRadius: 25,
        marginTop: "-7%",
        marginBottom:"10%",
        backgroundColor: "#4D1A70",
        justifyContent: "center",
        
    }



})



export default function Inicioscreen({ navigation}) {
    return (
        <View  style={styles.view}>
            <ImageBackground 
                source={require('../Img/fondo_inicio.png')} 
                style={styles.fondo}
            >
            
            <Btn onClick={() => navigation.navigate("Login")} title="Inicia sesion" style={styles.btn1} />
            <Btn color="#000" onClick={() => navigation.navigate("Sign Up")} title="Registrate ahora" style={styles.btn2} />

                

            </ImageBackground>
        </View>
    )
}
